  <?php 
  $peta = $this->db->query("SELECT * FROM kavling_peta")->result();



  foreach ($peta as $pt) {
    if($pt->status == '0'){
      $warna = '#ffffff';
    }elseif($pt->status == '1'){
      $warna = '#FFF693';
    }elseif($pt->status == '2'){
      $warna = '#3DBEF0';
    }elseif($pt->status == '3'){
      $warna = '#F08519';
    }

    if($pt->jenis_map == 'polygon'){

        $x = $y = 0; // For those running with Notices on...

        $poly0 = str_replace(' ',',',$pt->map);
        $poly = explode(",",$poly0);

        
                $polygon = array_chunk($poly,2); // Chunk Array in coords
                $n       = count($polygon);      // Calc Once
        
               

                for($i=0;$i<$n;$i++)
                {
                        $x+=$polygon[$i][0];
                        $y+=$polygon[$i][1];
                }
                $x = round($x/$n); $y = round($y/$n);

        echo '<a href="#bawah" onclick="add('.$pt->id_kavling.')">
           
            <polygon class="fil6" points="'.$pt->map.'" style="fill:'.$warna.'"/>
            <text x="'.$x.'" y="'.$y.'"  class="fil7 fnt1" style="font-size:6rem !important;">'.$pt->kode_kavling.'</text>
            
        </a>';
        }
  } 
  
  //Hitung statistik
  $stt_1 = $this->db->query("SELECT * FROM kavling_peta WHERE status='1'")->num_rows();
  $stt_2 = $this->db->query("SELECT * FROM kavling_peta WHERE status='2'")->num_rows();
  $stt_3 = $this->db->query("SELECT * FROM kavling_peta WHERE status='3'")->num_rows();
  $stt_0 = $this->db->query("SELECT * FROM kavling_peta")->num_rows();

  $kosong = $stt_0 - ($stt_1 + $stt_2 + $stt_3);
  ?>
